import React from "react";

// Core Components
import { Button } from "@material-ui/core";
import NavBar from "./modules/NavBar";

// Icon Components
import ExpandMoreIcon from "@material-ui/icons/ExpandMore";

export default function App()
{
    return (
        <>
            <div className="App" style={{ flexgrow: 1 }}>
                <NavBar />
                <body>
                    <section class="nameplate" style={{ height: 1080 + "px", textAlign: "center" }}>
                        <h1 class="heading">DAVID RYAN</h1>
                        <h2 class="subheading">Computer Science Student &<br/>Self-Taught Software Developer</h2>

                        <h5>Read More</h5>
                        {/* <Button> */}
                            <ExpandMoreIcon htmlColor="#ffffff" href="#"/>
                        {/* </Button>                     */}
                    </section>
                </body>
            </div>
        </>
    );
}
